import React from "react";
import "./App.css";

function App() {

  const[ownerName, setOwnerName] = ('')
  const[ownerCpf, setOwnerCpf] = ('')
  const[ownerData, setOwnerData] = ('')
  const[ownerSexo, setOwnerSexo] = ('')

  return (
    <div className="App">
      <h1>CRUD APPLICATION</h1>
      <div className="form">
        <label>Nome Completo:</label>
        <input type="text" name="ownerName" onChange={ (e)=> {
          setOwnerName(e.target.value)
        } }></input>
        <label>CPF:</label>
        <input type="text" name="ownerCpf" onChange={ (e)=> {
          setOwnerCpf(e.target.value)
        } }></input>
        <label>Data de Nascimento:</label>
        <input type="date" name="ownerData" onChange={ (e)=> {
          setOwnerData(e.target.value)
        } }></input>
        <label>Sexto:</label>
        <input type="text" name="ownerSexo" onChange={ (e)=> {
          setOwnerSexo(e.target.value)
        } }></input>
        <button>Submit </button>
      </div>
    </div>
  );
}

export default App;
